class Solution(object):
    def twoSum(self, numbers, target):
        """
        :type numbers: List[int]
        :type target: int
        :rtype: List[int]
        """

        dn, up = 0, len(numbers)-1

        while dn < up:
            s = numbers[dn] + numbers[up]
            if s == target:
                return [dn+1, up+1]
            elif s < target:
                dn += 1
            else:
                up -= 1

